import * as React from 'react';
import Backdrop from '@mui/material/Backdrop';
import Box from '@mui/material/Box';
import Modal from '@mui/material/Modal';
import Fade from '@mui/material/Fade';
import Button from '@mui/material/Button';
import Typography from '@mui/material/Typography';
import styled from "styled-components"
import CloseIcon from '@mui/icons-material/Close';


const style = {
  position: 'absolute',
  top: '50%',
    left: '50%',
    width: '90%',
    height: '90vh',
  transform: 'translate(-50%, -50%)',
  bgcolor: 'background.paper',
  boxShadow: 24,
  p: 4,
};

export default function AddUserModal({ handleOpen, open, setOpen }) {
  //const handleOpen = () => setOpen(true);
  const handleClose = () => setOpen(false);

  return (
    <div>
      <Modal
        aria-labelledby="transition-modal-title"
        aria-describedby="transition-modal-description"
        open={open}
        onClose={handleClose}
        closeAfterTransition
        BackdropComponent={Backdrop}
        BackdropProps={{
          timeout: 500,
        }}
      >
        <Fade in={open}>
          <Box sx={style}>
        <ModalWrap>
        <div style={{width: 40, height: 40, borderRadius: '50%', display:'flex', justifyContent:'center', alignItems:'center', border:'1px solid black', cursor:'pointer' }} onClick={handleClose}>
        <CloseIcon />
        </div>
                      </ModalWrap>
                <StepForm>
                <div style={{width: '30%', background: 'green', height:'100vh', padding: 20}}>
                              <Typography variant="h6" component="h6" mt={2}>Add New User</Typography>
                              <div>

                              </div>
                </div>
                          <div style={{width: '70%', background: 'yellow', height:'100vh'}}>

                              </div>
                </StepForm>
          </Box>
        </Fade>
      </Modal>
    </div>
  );
}



const ModalWrap = styled.div`
width: 100%;
 display:flex;
justify-content: end;
`;

const StepForm = styled.div`
width: 100%;
display:flex;
background: red;
justify-content: space-around;
`;
